  const dispatch = useDispatch();
  const {tour} = useSelector(state => state)

  useEffect(() => {
    dispatch(getTour());
  }, []);

  useEffect(()=> {
    console.log(tour)
  },[tour])

  return tourData?.map((tour, i) => (
    <Col lg="3" key={i}>
      <TourCard tour={tour} />
    </Col>
  ));
};

export default FeaturedTourList;
